// 辅助函数
const getStatusColor = (status)=>{
    switch(status){
        case 'active':
            return 'success';
        case 'expired':
            return 'error';
        case 'scheduled':
            return 'warning';
        default:
            return 'default';
    }
};
const getDiscountStatus = (startDate, endDate)=>{
    const now = new Date();
    const start = new Date(startDate);
    const end = new Date(endDate);
    if (now < start) return 'scheduled';
    if (now > end) return 'expired';
    return 'active';
};
